<template>
    <hr/>
</template>
<script>
import loc from './delimiter.i18n.json';
import Delimiter from './Delimiter';
import { i18n } from "../../../../utility/VueI18n";
const d = new Delimiter();
export default {
    i18n: i18n(loc),
    props: {
        /**
         * empty object
         */
        value: {
            type: Object,
            default() {
                return d.getEmptyData();
            }
        },
        config: {
            type: Object,
            default() {
                return d.getEmptyConfig();
            }
        }
    },
}
</script>